import React from 'react'
import Cell from './Cell'

export default ({gridData, updateCell, columns}) => {

    // const makecells = gridData.map(cell => <Cell key={cell.position} {...cell} updateCell={updateCell} />)
    const makecells = () => gridData.map((key, value) => <Cell key={key} position={key} value={value} updateCell={updateCell} />)

    // const makecells = () => {
    //     for (const key in gridData) {
    //         if (object.hasOwnProperty(key)) {
    //             const element = object[key];
    //         }
    //     }
    // }



    return (
        <>
            <div 
                id='grid' 
                className='grid'
                style={{
                    display: 'grid',
                    gridTemplateColumns: `repeat(${columns}, 2rem)`,
                    gridTemplateRows: 'repeat(20, 2rem)',
                }}
            >
                {makecells()}
            </div>
        </>
    )
}
